import React, { useEffect, useState } from "react";
import { Map, TileLayer, ZoomControl } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";
import { Map as MapProp, tileLayer } from "leaflet";

function Solution() {
  return (
    <PageContainer>
      <Map
        center={[39.1, -76.1]}
        zoom={10}
        scrollWheelZoom={true}
        zoomControl={false}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
        />
        <TileLayer
          url={`https://tile.openweathermap.org/map/precipitation_new/{z}/{x}/{y}.png?appid=e6d8c9c20269bd6d193a610ab4f7d761`}
        />
        <ZoomControl position="topright" />
      </Map>
    </PageContainer>
  );
}

export default Solution;
